import {Navbar, Container, Nav, style} from "react-bootstrap";
import bootstrap from 'bootstrap/dist/css/bootstrap.css';
import {Link} from "react-router-dom";

const NavBarAsta = () => {
    return (
        <>
            <Navbar bg="dark" variant="dark">
                <Container>
                    <Nav.Link as={Link} to="/" style="none">Navbar</Nav.Link>
                    <Nav className="me-auto">
                    <Nav.Link as={Link} to="/Contacto" style="none">Contactanos</Nav.Link>
                    <Nav.Link as={Link} to="/medias" style="none">Medias</Nav.Link>
                    <Nav.Link as={Link} to="/Nosotros" style="none">Nosotros</Nav.Link>
                    </Nav>
                </Container>
            </Navbar>
        </>
    );

}

export default NavBarAsta;
